<div id="serie_info">La storia riprende dopo circa tre anni. Naruto torna al Villaggio della Foglia dopo un lungo allenamento con Jiraiya (uno dei tre Ninja supremi assieme ad Orochimaru e Tsunade). La storia coinvolge altri nemici, ovvero l'Organizzazione Alba, dedita alla cattura ed all'imprigionamento di tutti i nove cercoteri, ognuno sigillato in un ninja. Dopo avere ucciso suo fratello Itachi, Sasuke scopre che lo sterminio del suo clan, gli Uchiha, era stato commissionato dal consiglio degli anziani del Villaggio della Foglia. Perciò, si unisce ad Alba, in cambio dell'aiuto di questa, per distruggere il Villaggio. La storia prosegue, quindi, con Naruto che cerca di sfuggire e combattere l'Organizzazione e di redimere il suo migliore amico, considerato da lui come un fratello.</div>

